		console.log(result);
	} catch (err) {
		console.error(err);
	}
};

async function main() {
	await displaySchoolValue('Holberton');
	await setNewSchool('HolbertonSanFrancisco', '100');
	await displaySchoolValue('HolbertonSanFrancisco');
}

main();


